import React from 'react';

import TodoListItem from '../todo-list-item/todo-list-item';

const TodoList = ({ todos }) => {
    return (
        <ul>
            <li><TodoListItem label={todos[0].label} /></li>
            <li><TodoListItem 
              label="Build Awesome App" 
              important/></li>
        </ul>
    )
}

export default TodoList;
